import React, { useEffect, useState } from 'react'

function App() {

  const [backEndData, setBackEndData] = useState([{}])

  useEffect(() => {
    fetch("/api")
      .then(data => {setBackEndData(data)})
  }, [])

  return (
    <div>App</div>
  )
}

export default App
